$(document).ready(function(){$("body").scrollspy({target:".navbar",offset:50});$("#myNavbar a").on("click",function(e){if(this.hash!==""){e.preventDefault();var a=this.hash;$("html, body").animate({scrollTop:$(a).offset().top},500,function(){window.location.hash=a})}});var e=$("#header").innerHeight();$(window).scroll(function(){var a=$(window).width();if(a>600){var i=$(window).scrollTop();if(i>=e){$(".header-container").removeClass("header-container").addClass("navbar-fixed-top");$(".container-header").removeClass("container-header").addClass("croll-header")}else{$(".navbar-fixed-top").removeClass("navbar-fixed-top").addClass("header-container");$(".croll-header").removeClass("croll-header").addClass("container-header")}}else{$(".container-header").removeClass("container-header").addClass("bg-fix-top")}});$(window).scroll(function(){var a=$(window).scrollTop();if(a>=e){$(".wrapper section").each(function(e){if($(this).position().top<=a+$("#myNavbar").height()){$(".list-nav .nav-title.active").removeClass("active");$(".list-nav .nav-title").eq(e).addClass("active")}})}else{$("#wrapper ").removeClass("fixed");$(".list-nav .nav-title.active").removeClass("active");$(".list-nav .nav-title:first").removeClass("active")}}).scroll();$("#menu").click(function(){$(".list-nav ").toggleClass("animate-menu")});$(".nav-title").click(function(){$(".list-nav").removeClass("animate-menu");console.log("da actice")})});